import sketis1 from './images/Sketis5.jpg';
import kambarys1 from './images/Kambarys6.jpg';
import vonia1 from './images/Vonia15.jpg';
import useContentful from './useContentful';



const loadContentfulData = async () => {
    const contentful = useContentful();
    const entries = await contentful.getWorkItems();
    const Works = entries.map((entry) => ({
      physical: true, // or entry.fields.physical
      id: entry.sys.id,
      url: entry.fields.url,
      title: entry.fields.title,
      year: entry.fields.year,
      img1: entry.fields.imagePreview.fields.file.url, // assuming imagePreview is an Asset field
      // add more fields as necessary
    }));
    return works;
  };

  export const Works = await loadContentfulData();
